import BlogPost from "./components/Posts";
import posts from './data/blogposts'


function App() {
  return (
    <div className="App">
      {
        posts.map((post) => {
          return <BlogPost post={post} > HEllo</BlogPost>
        })
      }
    </div>
  );
}

export default App;
